import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AppStatusComponent } from './app-status/app-status.component';
import { ReportViewerComponent } from './report-viewer/report-viewer.component';

const routes: Routes = [
  { path: '', redirectTo: '/application-status', pathMatch: 'full' },
  { path: 'application-status', component: AppStatusComponent },
  { path: 'report-viewer', component: ReportViewerComponent },
  { path: '**', redirectTo: '/application-status' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})

export class AppRoutingModule { }
